interface iconInfo {
    [key: string]: ReactElement
}

export const SvgIcon = (params: string, big: boolean) => {
    const SvgComp = Icons[`${params}`]

    return (
        <div
            className={`${
                big
                    ? 'h-14 w-14 mx-5 my-2 rounded-full p-3 bg-white'
                    : 'h-6 w-6 mx-2 rounded-full p-1 bg-white'
            }   focus:outline-none relative  group/icon hover:scale-110 `}
        >
            {SvgComp}
            {/* Hover ile yaz */}
            <span
                className={`${
                    big
                        ? 'bottom-[-2rem] text-sm px-2 py-1'
                        : 'bottom-[-1rem] text-xs px-1'
                } absolute  text-gray-600 bg-gray-100  rounded opacity-0 group-hover/icon:opacity-100 transition-opacity duration-300 text-center items-center left-1/2 transform -translate-x-1/2`}
            >
                {params}
            </span>
        </div>
    )
}

const Icons: iconInfo = {
    Nestjs: NestjsIcon(),
    Nextjs: NextjsIcon(),
    Javascript: JavascriptIcon(),
    Typescript: TypescriptIcon(),
    Nodejs: NodejsIcon(),
    Jest: JestIcon(),
    Cypress: CypressIcon(),
    Python: PythonIcon(),
    Reactjs: ReactjsIcon(),
    Graphql: GraphqlIcon(),
    Django: DjangoIcon(),
    ElasticSearch: ElasticSearchIcon(),
    NxMonoRepo: NxMonoRepoIcon(),
    Postgresql: PostgresqlIcon(),
    MySQL: MySQLIcon(),
    MongoDB: MongoDBIcon(),
    Firebase: FirebaseIcon(),
    HTML: HTMLIcon(),
    CSS: CSSIcon(),
    TailwindCSS: TailwindCSSIcon(),
    DjangoRest: DjangoRestIcon(),
    Docker: DockerIcon(),
    Github: GithubIcon(),
    Git: GitIcon(),
    Postman: PostmanIcon(),
    ReactNative: ReactNativeIcon(),
}

export function iconSelector(icon: string) {
    switch (icon) {
        case 'workIcon':
            return <MdWorkOutline />
        case 'schoollIcon':
            return <FaSchool />
        case 'armyIcon':
            return <TbTank />
        default:
            return <FaSchool />
    }
}
